ReportDefinitionServiceReportCompressType:
  type: string
  nullable: true
  enum:
  - NONE
  - ZIP
  - UNKNOWN
  title: ReportDefinitionServiceReportCompressType
  description: |
    <div lang="ja">ReportDefinitionServiceReportCompressTypeは、定義されたダウンロードレポートの圧縮の有無を表します。<br>
    ADD時、このフィールドは省略可能となります。</div>
    <div lang="en">ReportDefinitionServiceReportCompressType displays if defined download report is compressed.<br>
    This field is optional in ADD operation.</div>
    <hr>
    <dl class=term>
      <dt class="term__item">NONE</dt>
      <dd class="term__desc"><span lang="ja">圧縮なしです。<br>※デフォルトに設定されます。</span><span lang="en">Not compressed.<br>*Default setting.</span></dd>
      <dt class="term__item">ZIP</dt>
      <dd class="term__desc"><span lang="ja">Zip圧縮されます。</span><span lang="en">Compressed to Zip file.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
